		select2: function select2() {

			function templateResult(item) {
				var markup = '\n\t\t\t\t    \t<div class="row">\n\t\t\t\t    \t\t<div class="col-sm-4">' + item.text + '</div>\n\t\t\t\t    \t\t<div class="col-sm-4">' + item.name + '</div>\n\t\t\t\t    \t\t<div class="col-sm-4">' + item.id + '</div>\n\t\t\t\t    \t</div>';
				return markup;
			}

			function templateSelection(item) {
				return item.text;
			}

			$('.select2').each(function () {
				var $this = $(this);
				var source = $this.data('source');
				if (source && source != '') {

					$this.select2({
						ajax: {
							url: source,
							dataType: 'json',
							delay: 250,
							data: function data(params) {
								return {
									q: params.term ? params.term : "a", // search term
									page: params.page
								};
							},
							processResults: function processResults(data, params) {
								params.page = params.page || 1;

								return {
									results: $.map(data, function (item) {
										return {
											text: item.first_name,
											name: item.last_name,
											id: item.first_name
										};
									}),

									pagination: {
										more: params.page * 30 < data.total_count
									}
								};
							},
							cache: true
						},
						escapeMarkup: function escapeMarkup(markup) {
							return markup;
						},
						minimumInputLength: 0,
						templateResult: templateResult,
						templateSelection: templateSelection
					});
				} else {
					$this.select2({
						theme: "bootstrap",
						placeholder: 'Select an option'
					});
				}
			});
		},
